import React from 'react';
import aditya from '../assets/Aditya.jpg';
import email from '../assets/Email_Icon.png';
import linkedin from '../assets/LinkedIn_Icon.png';

const Info = () => {
  return (
    <div>
      <div className='info'>
        <img src={aditya} className='info-photo' />
        <h3 className='info-name'>Aditya Rajkumar</h3>
        <h4 className='info-role'>React Developer</h4>
        <h5 className='info-website'>adityar.website</h5>
      </div>
      <div className='info-button'>
        <button>
          <img className='btn-email' />
          Email
        </button>
        <button>
          <img src={linkedin} className='btn-linkedin' />
          LinkedIn
        </button>
      </div>
    </div>
  );
};

export default Info;
